import React from 'react';
import styles from './SideBar.module.scss';


export function SideBar({busRoutes, getBusRouteUser})  {
  return(
    <div className={styles.sideBarDiv}>
      <header>
        <h2>Bus Routes</h2>
      </header>

      {busRoutes.map((busRoute, index) => 
        <button onClick={() => getBusRouteUser(index+1)} className={styles.activeButton}>{busRoute.name}</button>
      )}
    </div>
  )
}
